/** add multiple functions to page onload event */
function onLoad(func) {
    var oldonload = window.onload;
    if (typeof window.onload != 'function') {
        window.onload = func;
    } else {
        window.onload = function() {
            if (oldonload) {
                oldonload();
            }
            func();
        }
    }
}

    <script>
        /**
 * helper code to create ROC plots
 *
 * @author Peter Krusche <pkrusche@illumina.com>
 */
'use strict';

var PLOT;
if (PLOT === undefined) {
    PLOT = {};
}

(function (PLOT) {

    var X_METRIC = "METRIC.Recall";
    var Y_METRIC = "METRIC.Precision";
    var X_LABEL = "Recall";
    var Y_LABEL = "Precision";

    /** make sure that we show a large enough part of the plot on the axes */
    function fixDomain(d) {
        var MIN_EXTENT = 0.01;
        if (d[1] - d[0] < MIN_EXTENT) {
            d[0] -= MIN_EXTENT / 2;
            d[1] += MIN_EXTENT / 2;
        }
        d[0] = d3.min([1.0, d[0], d[1]]);
        d[0] = d3.max([0.0, d[0]]);
        d[1] = d3.min([1.0, d[1]]);
        d[1] = d3.max([0.0, d[0], d[1]]);
        return d;
    }

    /** make a SVG path for ROC points */
    function makeROCPath(x, y, rocdata) {
        rocdata.sort(function (a, b) {
            return b.QQ - a.QQ;
        });
        return (d3.svg.line()
                .x(function (d) {
                    return x(d[X_METRIC]);
                })
                .y(function (d) {
                    return y(d[Y_METRIC]);
                })
        )(rocdata);
    }

    /**
     * ROC Plot function
     * @param target Something D3 can select
     * @param data the data to plot
     */
    PLOT.roc = function (target, data) {
        var color = d3.scale.category10();

        var color_filters = {
            ALL: "black",
            PASS: "#f55"
        };

        /** preprocess data / add colors */
        data.forEach(function (d) {
            if (color_filters.hasOwnProperty(d.filter)) {
                d["STROKE"] = color_filters[d.filter];
            }
            else {
                d["STROKE"] = "gray";
            }
            d["FILL"] = color(d.method + " / " + d.comparisonmethod);
        });

        var margin = {top: 20, right: 50, bottom: 30, left: 100},
            width = 800 - margin.left - margin.right,
            height = 400 - margin.top - margin.bottom;

        var x = d3.scale.linear()
            .range([0, width]);

        var y = d3.scale.linear()
            .range([height, 0]);

        var xAxis = d3.svg.axis()
            .scale(x)
            .tickFormat(d3.format(".2%"))
            .ticks(6)
            .orient("bottom");

        var yAxis = d3.svg.axis()
            .scale(y)
            .ticks(4)
            .tickFormat(d3.format(".2%"))
            .orient("left");

        var svg = d3.select(target).append("svg")
            .attr("width", width + margin.left + margin.right)
            .attr("height", height + margin.top + margin.bottom)
            .append("g")
            .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

        /** plot clipping */
        svg.append("svg:clipPath")
            .attr("id", "clip")
            .append("svg:rect")
            .attr("x", 0)
            .attr("y", -50)
            .attr("width", width + 20)
            .attr("height", height + 50);
        svg.append("rect");

        var xdomain = fixDomain(d3.extent(data, function (d) {
            return d[X_METRIC];
        }));
        x.domain(xdomain).nice();

        var ydomain = fixDomain(d3.extent(data, function (d) {
            return d[Y_METRIC];
        }));
        y.domain(ydomain).nice();

        var zoom = d3.behavior.zoom()
            .x(x)
            .y(y)
            .scaleExtent([0.01, 5])
            .on("zoom", zoomed);

        var plot_g = svg
            .append("g")
            .attr("clip-path", "url(#clip)");
        plot_g.append("rect")
            .attr("x", 0)
            .attr("y", 0)
            .attr("width", width + 20)
            .attr("height", height + 50)
            .style("fill", "#fff")
            .on("mousedown", function () {
                if (d3.event.ctrlKey) {
                    zoom.scale(1);
                    zoom.translate([0, 0]);
                    zoom.x(x.domain(xdomain).nice());
                    zoom.y(y.domain(ydomain).nice());
                    zoomed();
                    return true;
                }
                if (!d3.event.shiftKey) {
                    return true;
                }
                var e = this,
                    origin = d3.mouse(e),
                    rect = svg.append("rect").attr("class", "zoom");

                origin[0] = Math.max(0, Math.min(width, origin[0]));
                origin[1] = Math.max(0, Math.min(height, origin[1]));
                d3.select(window)
                    .on("mousemove.zoomRect", function () {
                        var m = d3.mouse(e);
                        m[0] = Math.max(0, Math.min(width, m[0]));
                        m[1] = Math.max(0, Math.min(height, m[1]));
                        rect.attr("x", Math.min(origin[0], m[0]))
                            .attr("y", Math.min(origin[1], m[1]))
                            .attr("width", Math.abs(m[0] - origin[0]))
                            .attr("height", Math.abs(m[1] - origin[1]));
                    })
                    .on("mouseup.zoomRect", function () {
                        d3.select(window).on("mousemove.zoomRect", null).on("mouseup.zoomRect", null);
                        var m = d3.mouse(e);
                        m[0] = Math.max(0, Math.min(width, m[0]));
                        m[1] = Math.max(0, Math.min(height, m[1]));
                        if (m[0] !== origin[0] && m[1] !== origin[1]) {
                            zoom.x(x.domain([origin[0], m[0]].map(x.invert).sort()))
                                .y(y.domain([origin[1], m[1]].map(y.invert).sort()));
                        }
                        rect.remove();
                        zoomed();
                    }, true);
                d3.event.stopPropagation();
            })
            .append("svg:title").text("Shift-click to zoom, ctrl-click to reset.");

        plot_g.call(zoom);

        svg.append("g")
            .attr("class", "x axis")
            .attr("transform", "translate(0," + height + ")")
            .call(xAxis)
            .append("text")
            .attr("class", "label")
            .attr("x", width)
            .attr("y", -6)
            .style("text-anchor", "end")
            .text(X_LABEL);

        svg.append("g")
            .attr("class", "y axis")
            .call(yAxis)
            .append("text")
            .attr("class", "label")
            .attr("transform", "rotate(-90)")
            .attr("y", 6)
            .attr("dy", ".71em")
            .style("text-anchor", "end")
            .text(Y_LABEL);

        /** this can probably be improved, currently we remove everything and
         *  draw from scratch on zoom
         */
        function zoomed() {
            plot_g.selectAll(".roc").remove();
            plot_g.selectAll(".dot").remove();

            plot_g.selectAll(".roc")
                .data(data)
                .enter().append("path")
                .attr("class", "roc")
                .attr("stroke", function (d) {
                    return d.FILL;
                })
                .style("stroke-width", 2)
                .style("stroke-dasharray", function (d) {
                    if (d.filter == "PASS") {
                        return "4,4";
                    } else {
                        return null;
                    }
                })
                .style("fill", "none")
                .attr("d", function (d) {
                    return makeROCPath(x, y, d.roc);
                });

            plot_g.selectAll(".dot")
                .data(data)
                .enter().append("circle")
                .attr("class", "dot")
                .attr("r", 8)
                .attr("cx", function (d) {
                    return x(d[X_METRIC]);
                })
                .attr("cy", function (d) {
                    return y(d[Y_METRIC]);
                })
                .style("stroke", function (d) {
                    return d.STROKE;
                })
                .style("stroke-width", "2px")
                .style("fill", function (d) {
                    return d.FILL;
                });
            svg.select(".x.axis").call(xAxis);
            svg.select(".y.axis").call(yAxis);
        }

        zoomed();

        var legend = svg.selectAll(".legend")
            .data(color.domain())
            .enter().append("g")
            .attr("class", "legend")
            .attr("transform", function (d, i) {
                return "translate(0," + i * 40 + ")";
            });

        var fc = Object.keys(color_filters);
        fc.sort();

        fc.forEach(function (f, i) {
            legend.append("circle")
                .attr("cx", width - 9)
                .attr("cy", 20 * i + 9)
                .attr("r", 8)
                .style("stroke", color_filters[f])
                .style("stroke-width", "2px")
                .style("fill", color);

            legend.append("text")
                .attr("x", width - 24)
                .attr("y", 20 * i + 9)
                .attr("dy", ".35em")
                .style("text-anchor", "end")
                .text(function (d) {
                    return d + ": " + f;
                });
        });

    };
})(PLOT);

                field: "TRUTH.TP",
                header: "TP",
                format: d3.format("d")
            },
            {
                field: "TRUTH.FN",
                header: "FN",
                format: d3.format("d")
            },
            {
                field: "QUERY.FP",
                header: "FP",
                format: d3.format("d")
            },
            {
                field: "FP.gt",
                header: "GT Mismatches",
                format: d3.format("d"),
                'class': "collapse collapsed"
            },
            {
                field: "FP.al",
                header: "Allele Mismatches",
                format: d3.format("d"),
                'class': "collapse collapsed"
            },
            {
                field: "QUERY.UNK",
                header: "UNK",
                format: d3.format("d"),
                'class': "collapse collapsed"
            }
        ];

        var filters_seen = {};
        data.forEach(function (d) {
            filters_seen[d["filter"]] = 1;
        });

        var tbl = d3.select("#table_snp_table");
        tbl.append("thead").append("tr").selectAll("th")
                .data(columns).enter()
                .append("th")
                .attr("class", function (d) {
                    return d["class"];
                })
                .text(function (d) {
                    return d.header;
                });

        tbl.append("tbody").selectAll("tr")
                .data(data).enter()
                .append("tr")
                .selectAll("td")
                .data(columns).enter()
                .append("td")
                .attr("class", function (d) {
                    return d["class"];
                })
                .text(function (d) {
                    var data_item = d3.select(this.parentNode).datum();
                    var val = data_item[d.field];
                    if (d.format !== undefined) {
                        if (isNaN(val)) {
                            return "(n/a)";
                        }
                        else {
                            return d.format(val);
                        }
                    } else {
                        return val;
                    }
                });

        /** expand / collapse button */
        var addmetrics_button = d3.select("#table_snp_table_expand").on("click", function () {
            updateButton(addmetrics_button, !buttonState(addmetrics_button));
            updateVisibility();
        });

        /** expand / collapse all calls button */
        var allcalls_button = d3.select("#table_snp_table_allcalls").on("click", function () {
            updateButton(allcalls_button, !buttonState(allcalls_button));
            updateVisibility();
        });

        /** search box */
        var searchbox = d3.select("#table_snp_table_search")
                .attr("placeholder", "Filter Rows")
                .on("keyup", function () {
                    updateVisibility();
                });

        /** don't hide things when there is only one kind of filter */
        if (Object.keys(filters_seen).length > 1) {
            allcalls_button.style("visibility", "visible");
            buttonState(allcalls_button, false);
        } else {
            allcalls_button.style("visibility", "hidden");
            buttonState(allcalls_button, true);
        }

        updateVisibility();

        /** show / hide buttons */
        function buttonState(b) {
            return b.text().indexOf("Show") < 0;
        }

        function updateButton(b, state) {
            var bstate = buttonState(b);
            if (state == bstate) {
                return;
            }
            var btext = b.text();
            if (!state) {
                b.text(btext.replace("Hide", "Show"));
            } else {
                b.text(btext.replace("Show", "Hide"));
            }
        }

        /** show / hide rows according to filtering */
        function updateVisibility() {
            var additional_metrics = buttonState(addmetrics_button);

            /** additional metrics also hide columns, handle this separately from filtering below */
            if (additional_metrics) {
                tbl.selectAll(".collapse").classed("collapsed", false);
                tbl.classed("tinytext", true);
            } else {
                tbl.selectAll(".collapse").classed("collapsed", true);
                tbl.classed("tinytext", false);
            }

            var allcalls = buttonState(allcalls_button);
            var searchTerm = searchbox.node().value;

            var terms = searchTerm.toLowerCase().split(/ /);
            var row = tbl.selectAll("tbody tr");
            row.classed("hidden", true);
            row.filter(function (r) {
                var res = false;
                var columns = Object.keys(r);

                if (!additional_metrics && (r["subset"] != "*" || r["subtype"] != "*")) {
                    return false;
                }

                if (!allcalls && r["filter"] != "PASS") {
                    return false;
                }

                for (var i = 0; i < terms.length; ++i) {
                    var t = terms[i];
                    var column_value;

                    if (t.indexOf(":") >= 0) {
                        var x = t.split(":");

                        if (x.length >= 2) {
                            var col = x[0];
                            var sx = x.slice(1).join(":");
                            column_value = "" + r[col];
                            column_value = column_value.toLowerCase();
                            if (column_value.indexOf(sx) >= 0) {
                                res = true;
                                break;
                            }
                        }
                    } else {
                        for (var j = 0; j < columns.length; ++j) {
                            column_value = "" + r[columns[j]];
                            column_value = column_value.toLowerCase();
                            if (column_value.indexOf(t) >= 0) {
                                res = true;
                                break;
                            }
                        }
                    }

                    if (res) {
                        break;
                    }
                }
                return res;
            }).classed("hidden", false);

        }
    });

                    return d["class"];
                })
                .text(function (d) {
                    var data_item = d3.select(this.parentNode).datum();
                    var val = data_item[d.field];
                    if (d.format !== undefined) {
                        if (isNaN(val)) {
                            return "(n/a)";
                        }
                        else {
                            return d.format(val);
                        }
                    } else {
                        return val;
                    }
                });

        /** expand / collapse button */
        var addmetrics_button = d3.select("#table_indel_table_expand").on("click", function () {
            updateButton(addmetrics_button, !buttonState(addmetrics_button));
            updateVisibility();
        });

        /** expand / collapse all calls button */
        var allcalls_button = d3.select("#table_indel_table_allcalls").on("click", function () {
            updateButton(allcalls_button, !buttonState(allcalls_button));
            updateVisibility();
        });

        /** search box */
        var searchbox = d3.select("#table_indel_table_search")
                .attr("placeholder", "Filter Rows")
                .on("keyup", function () {
                    updateVisibility();
                });

        /** don't hide things when there is only one kind of filter */
        if (Object.keys(filters_seen).length > 1) {
            allcalls_button.style("visibility", "visible");
            buttonState(allcalls_button, false);
        } else {
            allcalls_button.style("visibility", "hidden");
            buttonState(allcalls_button, true);
        }

        updateVisibility();

        /** show / hide buttons */
        function buttonState(b) {
            return b.text().indexOf("Show") < 0;
        }

        function updateButton(b, state) {
            var bstate = buttonState(b);
            if (state == bstate) {
                return;
            }
            var btext = b.text();
            if (!state) {
                b.text(btext.replace("Hide", "Show"));
            } else {
                b.text(btext.replace("Show", "Hide"));
            }
        }

        /** show / hide rows according to filtering */
        function updateVisibility() {
            var additional_metrics = buttonState(addmetrics_button);

            /** additional metrics also hide columns, handle this separately from filtering below */
            if (additional_metrics) {
                tbl.selectAll(".collapse").classed("collapsed", false);
                tbl.classed("tinytext", true);
            } else {
                tbl.selectAll(".collapse").classed("collapsed", true);
                tbl.classed("tinytext", false);
            }

            var allcalls = buttonState(allcalls_button);
            var searchTerm = searchbox.node().value;

            var terms = searchTerm.toLowerCase().split(/ /);
            var row = tbl.selectAll("tbody tr");
            row.classed("hidden", true);
            row.filter(function (r) {
                var res = false;
                var columns = Object.keys(r);

                if (!additional_metrics && (r["subset"] != "*" || r["subtype"] != "*")) {
                    return false;
                }

                if (!allcalls && r["filter"] != "PASS") {
                    return false;
                }

                for (var i = 0; i < terms.length; ++i) {
                    var t = terms[i];
                    var column_value;

                    if (t.indexOf(":") >= 0) {
                        var x = t.split(":");

                        if (x.length >= 2) {
                            var col = x[0];
                            var sx = x.slice(1).join(":");
                            column_value = "" + r[col];
                            column_value = column_value.toLowerCase();
                            if (column_value.indexOf(sx) >= 0) {
                                res = true;
                                break;
                            }
                        }
                    } else {
                        for (var j = 0; j < columns.length; ++j) {
                            column_value = "" + r[columns[j]];
                            column_value = column_value.toLowerCase();
                            if (column_value.indexOf(t) >= 0) {
                                res = true;
                                break;
                            }
                        }
                    }

                    if (res) {
                        break;
                    }
                }
                return res;
            }).classed("hidden", false);

        }
    });
